import Header from "../components/header";

const data=["jim","mary","lilliputh"]
const Gallery =()=>{
    return(
        <div>
            {data.map((woman,i)=>{
                <div key={i}>
                    <span>{`Hi my name is ${woman.name}`}</span>
                </div>
            })}
        </div>
    )
}
